import React from "react";

class Play extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      nameOne: "",
      nameTwo: "",
      selectOneX: false,
      selectOneO: false,
      selectTwoX: false,
      selectTwoO: false,
      selectPage: true,
    };
  }

  render() {
    return (
      <div className="playMain">
        <div className="playHeader ">
          <div className="userName nameLeft">
            <button className="btnLeft">X</button>
            <label>{this.props.infoUsers.nameOne}</label>
          </div>
          <div>
            <button className="newGame btn">New Games</button>
          </div>
          <div className="userName nameRight">
            <button className="btnRight">X</button>
            <label>{this.props.infoUsers.nameTwo}</label>
          </div>
        </div>
      </div>
    );
  }
}
export default Play;
